import React, { useContext } from 'react'
import { GlobalContext } from '../Context/GlobalContext'
import { useParams } from 'react-router-dom'

const BACK_END_URL = process.env.REACT_APP_BACKEND_URL

export default function ClientColorChart() {

    const { client_id } = useParams()
    const { currentClient, setCurrentClient } = useContext(GlobalContext)

  return (
    <div className='flex flex-col items-center'>
            <h2 className="card-title mt-5 text-base-100 bg-neutral-focus h-10 pr-2 pl-2">{`CLIENT NAME HERE`}</h2>
            <div className='flex justify-center mt-5'>
                <div className="tabs">
                    <a className="tab tab-lifted tab-lg">Formulas</a>
                    <Link to={`/client/${client_id}`} className="tab tab-lifted tab-lg ">Info</Link>
                    <a className="tab tab-lifted tab-lg tab-active">Color Chart</a>
                </div>
            </div>
        </div>
  )
}
